import React from 'react';
import logo from './logo.svg';
import NavBar from 'react-bootstrap/Navbar'
import './App.css';

function App() {
  return (
    <div className="App">
      <NavBar>

      </NavBar>
    </div>
  );
}

class Car{
  constructor(name){
    this.brand = name;
  }
}

var mycar = new Car("Ford");
document.write(mycar.brand);

export default App;
